function About() {
  return (
    <>
      <div style={{marginTop:'5rem',width:'100%',height:'10px'}} className="about-scroll"></div>

      <div className="container about">

          <h2 className="main-title about-h2 text-center">ABOUT</h2>
            <p className="main-p text-center">
            We believe in maintaining a trustworthy relationship with our clients, providing the most creative ideas for their business development, and continuing to deliver high-quality services in every project we take up. Ultimately our aim is to help our clients reach out to broader audience and increase their revenue.
            </p>
            <div className="text-center">
            <img alt="about" src="../img/img1.png" className="img-fluid" />

          </div>
        </div>

    </>
  );
}
export default About;
